(I) Improvement of existing national capacities, policies and regulations which facilitate the widespread implementation of sustainable forest management, integrating energy efficiency, biodiversity, sustainable land management and livelihood considerations;
(II) Community-based sustainable forest management is being implemented effectively within a context of cantonment/province, district and commune level planning and delivering concrete benefits to local communities; 
(III) Strengthened demand and supply chain for energy efficient cook stoves.
